import { DataGrid } from '@mui/x-data-grid';
import axios from 'axios';
import * as React from 'react';
import {useEffect, useState} from 'react'
import {FormGroup} from '@mui/material'

function App() {
  const [data, setData] = useState([])
  const [pid, setPid] = useState<string>("")

  async function getData(event:any){
    event.preventDefault()
    try {
      let response = await axios.post("http://localhost:5000/items/getItems", {pid:pid})
      setData(response.data)
    }
    catch (err){
      console.log(err)
    }
  }

  const columns = [
    { field:"id", headerName:"ID", width: 20},
    { field: "wizProduct", headerName: "Animal Wiz Product", width:200},
    { field: "amazonProducts", headerName: "Amazon Products", width:200},
    { field: "petSmartProducts", headerName: "Pet Smart Products", width:200}
  ];

  const rows = [
    {id:1, wizProduct:"Shoes", amazonProducts: ["Shoe1","Shoe2"], petSmartProducts:["Shoe1", "Shoe2"]}
  ];

  return (
    <>
     <form onSubmit={getData}>
        <label>
          PID:
          <input type="number" value={pid} onChange={(e) => {setPid(e.target.value)}} />
        </label>
        <input type="submit" value="Submit" />
      </form>

    <div style={{height:500, margin:"auto"}}>
      <DataGrid
          rows={rows}
          columns={columns}
          pageSize={5}
          rowsPerPageOptions={[5]}
          checkboxSelection
      />

    </div>
    </>
  );
}

export default App;
